import React from 'react';
import {AboutContainer} from './AboutElements';
import Img from '../images/ABOUT.svg';

const About = ({img}) => {
    return (
        <AboutContainer>
            ABOUT ME
            <Img src={img}/>
        </AboutContainer>
    )
}

export default About;
